The Office Importer allows users to import office documents like word documents, spread sheets and presentations into wiki pages easily. Currently office importer has two flavours; the office importer application, which allows converting existing office documents into wiki pages and the wysiwyg integration, which allows copy/pasting office content into wysiwyg editor. The Office Importer features include:

* Convert existing documents into wiki pages
* Use common office suits as wiki authoring tools
* Avoid the learning curve associated with wiki syntax

{{warning}}

The Office Importer supports Office 2007 file formats only starting with XWiki Enterprise version 2.2 Milestone 1.

{{/warning}}

{{warning}}

The Office Importer requires a back-end Open Office server for its operations.

{{/warning}}

= Office Importer Application =

The application version of the office importer is meant to be used in situations where you want to convert office documents into individual wiki pages. That is, the importer application generates a new wiki page for each new office document. **[[Click here to access the Office Importer Application documentation.>>extensions:Extension.Office Importer Application#HHowtouse]]**

